import "./App.css";
import StyledButton from "./componentes/Button";

import GoogleIcon from "@mui/icons-material/Google";

const GoogleLoginButton = () => {
  return (
    <IconButton className="google-login-button">
      <GoogleIcon />
      Entrar com Google
    </IconButton>
  );
};


const App = () => {
  return (
    <div className="login-page">
      <div className="image-section"></div>
      <div className="login-section">
        <form className="login-form" action="/login" method="post">
          <div className="aviso">
            <h2>Plataforma</h2>
            <h2 className="plogin">Login</h2>
            <p>Bem vindo! Insira seu cadastro</p>
          </div>
          <div className="input-container">
            <input type="username" placeholder="Email" />
            <input type="password" placeholder="Senha" />
            <a className="forgot-password" href="./LoginPage.js">
              Esqueci senha
            </a>
          </div>
          <StyledButton label="Entrar" />
          <span className="or-separator">Ou inscreva-se usando</span>
        </form>
      </div>
    </div>
  );
};

export default App;
